/* eslint-disable react/jsx-boolean-value */
/* eslint-disable no-useless-escape */
/* eslint-disable arrow-body-style */
/* eslint-disable no-param-reassign */
/* eslint-disable yoda */
/* eslint-disable prefer-const */
/* eslint-disable no-undef */
/* eslint-disable no-unused-vars */
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import PropTypes from "prop-types";
import Divider from "@mui/material/Divider";
import {
  Grid,
  TextField,
  Box,
  Typography,
  Menu,
  MenuItem,
} from "@mui/material";
import { useState, useEffect } from "react";
import InputLabel from "@mui/material/InputLabel";
import FormControl from "@mui/material/FormControl";
import React from "react";
import { styled } from "@mui/material/styles";

type DialogEquipmentProps = {
  open: boolean;
  close: (reason: any) => void;
};

// eslint-disable-next-line arrow-body-style
const DialogEquipment = ({ open, close }: DialogEquipmentProps) => {
  const [isBluePressed, setIsBluePressed] = useState<boolean>(false);
  return (
    <>
      <Dialog open={open} onClose={close} fullWidth={true} maxWidth="sm">
        <DialogTitle>Undoing Box</DialogTitle>
        <DialogContent>
          <DialogContentText align="left">
            <Grid
              container
              spacing={8}
              sx={{
                display: "flex",
                alignItems: "center",
                flexDirection: "row",
              }}
            >
              <Grid item xs={12} md={12}>
                <Typography variant="body2">
                  우리 이쁜이 안녕? You pressed this button because you wanted
                  to say goodbye or break up to me, right? You must have had a
                  hard time today. 우리 이쁜이. 너무 수고했어. <br />
                </Typography>
                <br />
                <Typography variant="body1">
                  Lets take some 5 min of Rest time first and cool down
                  yourself.
                </Typography>
                <br />
                <Typography variant="body2">
                  Did you all rest? I think I've probably cleared my mind. Then
                  let's press blue button. Then you'll change your mind about
                  breaking up.
                </Typography>
              </Grid>
            </Grid>
            <Grid item xs={12} sm={12}>
              <Box
                sx={{ width: "550px", height: "600px" }}
                component="img"
                src="image/sarah.jpeg"
              ></Box>
            </Grid>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button
            variant="contained"
            style={{ color: "white" }}
            onClick={close}
          >
            Press Me
          </Button>
          <Button
            variant="contained"
            style={{ color: "white", background: "red" }}
            onClick={close}
          >
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default DialogEquipment;
